    false,nt"url": null,nt"notes": "NCEI Accession 0153501 includes physical
    and underway data collected aboard the ROBERT GORDON SPROUL during cruise SP1409
    in the North Pacific Ocean from 2014-11-14 to 2014-11-23. These data include CURRENT
    SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT (V). The
    instruments used to collect these data include ADCP and GPS. These data were collected
    by Daniel Brothers of US DOI; US Geological Survey, and by University of California
    - San Diego; Scripps Institution of Oceanography as part of Geophysical survey of
    active faults and submarine landslides of the Inner Continental Borderland offshore
    southern California. The Lamont-Doherty Earth Observatory (LDEO) submitted these
    data to NCEI as part of the NSF sponsored Rolling Deck to Repository (R2R) program.nnThe
    ADCP data represent the raw and automated processed data set. Post processed quality
    assessed data are not available in this accession.",nt"license_title": null,nt"extras":
